fn main() { let s1 = String::from("hello"); let s2: String = s1;
} Data is moved from one s1 and s1 is not accessible anymore - This is a problem: when s2 and s1 go out of scope, they will both try to free the same memory. This is known as a double free error and is one of the memory safety bugs we mentioned previously. Freeing memory twice can lead to memory corruption, which can potentially lead to security vulnerabilities. Rust doesnâ€™t need to free anything when s1 goes out of scope. when accessing it raises an error: value is borrowed here after move. Transfer ownership happens on function parameters as well. Another way to interect is via s1.close(). Struct must use #[derive(Copy, Clone, Debug)] annotation. For functions is not allowed to use s after the function ownership taken fn takes_ownership(s :String) { println!("on function: {}", s)
} fn main() { let s = String::from("hello"); // s comes into scope takes_ownership(s); // s's value moves into the function... println!("outside function: {}", s)
}

