} // returns with p2 lifetime if p2 has 'a.
// forcing the lifetime for the p1 variable allows the
// return.
fn function<'a>(p1 :&'a str, p2 :&str) -> &'a str{ ;; println!("function {p1} {p2}"); return p1
} These borrowed values has a lifetime - ensure that references are valid as long as we need them to be. &'a String means â€œa borrowed String which is valid for at least the lifetime a` Reference: https://doc.rust-lang.org/book/ch10-03-lifetime-syntax.html?highlight=lifetime#lifetime-elision

