Designing a library impl Library { fn new(books :Vec<Book>) -> Library { Library{ books } } fn len(&self) -> usize { self.books.len() } fn is_empty(&self) -> bool { self.books.is_empty() } fn add_book(&mut self, book: Book) { self.books.push(book) } fn print_books(&self) { for b in self.books.iter() { println!("{}", b) } } fn oldest_book(&mut self) -> Option<&Book> { self.books.sort_by(|a, b| a.year.cmp(&b.year)); self.books.first() }
} fn main() { // This shows the desired behavior. Uncomment the code below and // implement the missing methods. You will need to update the // method signatures, including the "self" parameter! let books :Vec<Book> = vec!(); let mut library = Library::new(books); println!("Our library is empty: {}", library.is_empty()); library.add_book(Book::new("Lord of the Rings", 1954)); library.add_book(Book::new("Alice's Adventures in Wonderland", 1865)); library.print_books(); match library.oldest_book() { Some(book) => println!("My oldest book is {book}"), None => println!("My library is empty!"), } println!("Our library has {} books", library.len());
}

